import React from 'react';

export const Song = (props) => {
    let song = props.song;
    let handleClick = props.handleClick;
	return (
		<div className='songs'>
			<div className='songs-top'>
				<p>{song.title}</p>
				<p>{song.artist}</p>
				<button onClick={handleClick}>Favorite</button>
			</div>
			<div className='songs-bottom'>
				<p>{song.time}</p>
			</div>
		</div>
	);
};
